var Articles = require('../model/articles-model');
var User = require("../model/user");
var router = require("express").Router();
var multer = require('multer');
var path = require("path");
var asyncHandler = require("express-async-handler");

//Create storage for file uploads
var fileStorage = multer.diskStorage({
  destination: function destination(req, file, cb) {
    cb(null, 'C:/Users/Thisara/Desktop/SLIIT/Y3S1/ITPM/Project/Mental_Health_Management_System/backend/src/api/Uploads/DOC');
  },
  filename: function filename(req, file, callback) {
    callback(null, file.originalname);
  }
});

// Create upload instances
var uploadFile = multer({
  storage: fileStorage
});

//Add article
router.post("/add", uploadFile.single('article'), function (req, res) {
  var newarticle = new Articles({
    title: req.body.title,
    type: req.body.type,
    category: req.body.category,
    description: req.body.description,
    article: req.file.originalname,
    authorName: req.body.authorName,
    postDate: req.body.postDate
  });
  newarticle.save().then(function () {
    res.json("Added");
  })["catch"](function (err) {
    console.log(err);
  });
});

//Get article
router.route("/viewArticle").get(function (req, res) {
  Articles.find().then(function (Articles) {
    res.json(Articles);
  })["catch"](function (err) {
    console.log(err);
  });
});

//Get article by ID
router.route("/view/:id").get(function (req, res) {
  var articleID = req.params.id;
  Articles.findById(articleID).then(function (article) {
    if (article) {
      res.status(200).json(article);
    } else {
      res.status(404).send({
        status: "Article not found"
      });
    }
  })["catch"](function (err) {
    res.status(500).send({
      status: "Error with data retrieval",
      error: err.message
    });
  });
});

//Delete article
router["delete"]("/delete/:id", uploadFile.single("article"), function (req, res) {
  var articleID = req.params.id;
  Articles.findByIdAndDelete(articleID).then(function () {
    res.status(200).send({
      status: "Article deleted !!"
    });
  })["catch"](function (err) {
    res.status(500).send({
      status: "Error with delete article !!"
    });
  });
});

//update article
router.put("/updateArticle/:id", uploadFile.single("article"), function (req, res) {
  Articles.findById(req.params.id).then(function (post) {
    post.article = req.file.originalname;
    post.title = req.body.title;
    post.type = req.body.type;
    post.category = req.body.category;
    post.description = req.body.description;
    post.authorName = req.body.authorName;
    post.postDate = req.body.postDate;
    post.save().then(function () {
      return res.json('Post Updated');
    })["catch"](function (err) {
      return res.status(400).json("Error:".concat(err));
    });
  })["catch"](function (err) {
    return res.status(400).json("Error:".concat(err));
